import React from "react";
import { useParams } from "react-router-dom";

const ReimbursementDetail = () => {
  const { id } = useParams(); // Extract reimbursementId from the URL

  return (
    <div>
      <h1>Reimbursement Detail</h1>
      <p>Reimbursement ID: {id}</p>
      {/* You can fetch and display more details here based on the reimbursementId */}
    </div>
  );
};

export default ReimbursementDetail;
